      XRELATIVE(IZ)=0.
      GO TO 831
  840 MORE=1
  841 IZ=FREEFF(CARD)
      IF(IFFAIL.EQ.1)GO TO 98
      XRELATIVE(IZ)=FREEFF(CARD)
      GO TO 841
  850 READ(INPUTDATA,851)ABUND(1),ABUND(2),
     1 (ABUND(IZ),XRELATIVE(IZ),IZ=3,99)
