 1141 PART(1)=PART(1)+GMG1(I)*B        *EXP(-EMG1(I)*HCKT(J))
      PART(1)=PART(1)+5.*EXP(-53134.*HCKT(J))+15.*EXP(-54192.*HCKT(J))+
     1 28.*EXP(-54676.*HCKT(J))+9.*EXP(-57853.*HCKT(J))
      G=4.
