 1161 PART(1)=PART(1)+GSI1(I)*B        *EXP(-ESI1(I)*HCKT(J))
      PART(1)=PART(1)+76.*EXP(-53000.*HCKT(J))+71.*EXP(-57000.*HCKT(J))+
