      G=2.
      D1=109734.83/4.5/4.5*HCKT(J)
      GO TO 14
c 1180 B=BO1(J,1)
 1180 B=1.
c      IF(NLTEON.EQ.-1)B=1.
      PART(1)=B*(5.+3.*EXP(-158.265*HCKT(J))+EXP(-226.977*HCKT(J)))
      DO 1181 I=2,13
