      B=1.
c      IF(NLTEON.EQ.-1)B=1.
 1181 PART(1)=PART(1)+GO1(I)*B*EXP(-EO1(I)*HCKT(J))
      PART(1)=PART(1)+15.*EXP(-101140.*HCKT(J))+
     1 131.*EXP(-103000.*HCKT(J))+128.*EXP(-105000.*HCKT(J))+
