      B=1.
c      IF(NLTEON.EQ.-1)B=1.
 1201 PART(1)=PART(1)+GB1(I)*B*EXP(-EB1(I)*HCKT(J))
      PART(1)=PART(1)+6.*EXP(-57786.80*HCKT(J))+
