      PARAMETER (kw=72,mion=1006)
      COMMON /ACOOL/AC1(kw),AMG1(kw),AAL1(kw),ASI1(kw),AFE1(kw)
      COMMON /FREQ/FREQ,FREQLG,EHVKT(kw),STIM(kw),BNU(kw),WAVE,WAVENO
