     1(EXP(-MAX(ELIM-RYD*Z**2/5.**2,ELIM-WAVENO)*HCKT(J))
     2-EXP(-ELIM*HCKT(J)))
      DO 90 I=1,15
   90 H=H+X(I)*BOLT(I,J)
