c     1               5.700*((ELIM-ELEV(14))/WAVENO)**3)
      X(14)=.14E-18*(6.700*((ELIM-ELEV(14))/WAVENO)**4-
     1               5.700*((ELIM-ELEV(14))/WAVENO)**5)
   30 DO 100 J=1,NRHOX
