      H=FREQ3*2./2./(RYD*Z**2*HCKT(J))*
     1(EXP(-MAX(ELIM-RYD*Z**2/8.**2,ELIM-WAVENO)*HCKT(J))
     2-EXP(-ELIM*HCKT(J)))
      DO 90 I=1,14
   90 H=H+X(I)*BOLT(I,J)
  100 AMG2(J)=H*XNFP(J,79)*STIM(J)/RHO(J)
      RETURN
      END
 
